from fastapi import FastAPIimport uvicornfrom typing import Listfrom sqlalchemy.orm import Sessionfrom sqlalchemy import selectfrom backend.app.models.subjects import Subject as SubjectORMfrom backend.app.dependencies.database import SessionDepfrom backend.app.schemas.subjects import Subjectapp = FastAPI(title='my_mmf', debug=True, description='API_MY_MMF')@app.get("/subjects", response_model=List[Subject])def get_sub(session:SessionDep):    res = session.execute(select(SubjectORM)).scalars().all()    return resif __name__ == "__main__":    uvicorn.run('main:app', reload=True)